In this Order - 

“cartographic design” is the design process of creating a map to represent 
geographic information; 

“copyright licence” means a licence granted by Tailte Éireann to produce a 
copy of a product, specified in Part 1 or 3 of Schedule 2, for a specified 
purpose; 

“data licence agreement” means a licence for the use, distribution and access of 
one or more data sets specified in column 2 of Schedule 3; 

“DCM” means a Digital Cartographic Model that is a digital representation of 
the national map where the data is supplied in raster format after cartographic 
design has been applied; 

“DLM” means a Digital Landscape Model that is a digital representation of the 
national map, at different resolutions, where the data is supplied in vector 
format with no cartographic design applied; 

“DTM” means a Digital Terrain Model which is a 3 dimensional digital 
representation of a terrain surface; 

“geospatial” means information that describes the location, shape and other 
characteristics of objects and features on the Earth’s surface; 

“GIS” means a Geographic Information System that is designed to capture, 
store, manipulate, analyse and present geospatial or geographic data; 

“PLACE Data” means an extract of topographic data that is readily available 
for any location within the State; 

“PLACE Map” means a topographic map that is readily available for any 
location within the State; 

Notice of the making of this Statutory Instrument was published in 
“Iris Oifigiúil” of 24th March, 2023. 








